import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getLogs } from "../../actions/logs";

const LogItem = ({log}, key) => {
    const dispatch = useDispatch()
    const renderSwitch = (subjtype) =>
        {
            console.log(subjtype)
            switch(subjtype)
            {
                case "Сотрудник":
                    {
                        const popover = (
                            <Popover id="popover-basic">
                                <Popover.Title as="h3">{log.subject.first_name}</Popover.Title>
                                <Popover.Content>
                                <Table striped bordered hover size="sm" onClick={e => e.preventDefault()}>
                                      <thead>
                                          <tr>
                                            <th>ID</th>
                                              <th>Имя</th>
                                              <th>Фамилия</th>
                                          </tr>
                                      </thead>
                                      <tbody>
                                            <tr>
                                            <th>{log.subject.employeeid}</th>
                                              <th>{log.subject.first_name}</th>
                                              <th>{log.subject.last_name}</th>
                                            </tr>
                                      </tbody>
                                  </Table>
                              </Popover.Content>
                            </Popover>
                          );
                        return (
                            <OverlayTrigger trigger="focus" placement="right" overlay={popover}>
                                <Button>Взят сотрудником</Button>
                            </OverlayTrigger>
                        
                         )
                    }
                    
    
                default:
                return log.subjid
            }
        };
    return (
        
    <tr key={key}>
        <td>{log.subjtype}</td>
        <td>{renderSwitch(log.subjtype)}</td>
        <td>{log.act}</td>
        <td>{log.objtype}</td>
        <td>{log.objid}</td>
        <td>{log?.time}</td>
    </tr>
    );
};

export default LogItem ;
